import { useState } from "react";
import Header from "./components/Header";
import styled from "styled-components";
function App() {
  const url = `https://api.openweathermap.org/data/2.5/weather?q=Seoul&appid=b5e6daa16ad773508276891721b6c4ba`;
  let [location, setLocation] = useState("");
  return (
    <>
      <Header />
      <AppWrap>
        <div className="appContentWrap">
          <input
            placeholder="지역을 입력하세요"
            value={location}
            onChange={(e) => {
              setLocation(e.target.value);
            }}
            type="text"
          />
        </div>
      </AppWrap>
    </>
  );
}

export default App;

const AppWrap = styled.div`
  width: 100vw;
  height: 100vh;
  border: 1px red solid;

  .appContentWrap {
    left: 50%;
    top: 50%;
    positon: aboulute;
    border: 1px blue solid;
    padding: 20px;
  }
`;
